import FrostAPI from "./network_ts/api";
import { FrostError } from "./common_ts/error";

FrostAPI().signIn().then((api: FrostAPI) => {
    console.log(api.userID());
}).catch((reason: FrostError) => {

});

const TEST_VAR = '';
const TEST_VAR2 = 123;
const TEST_VAR3 = 123;

export { TEST_VAR, TEST_VAR2,TEST_VAR3 };
